import React from "react";
import banner from "./images/blue-door.jpg";
import high from "./images/sticker.png";


const Home = () => {
  return (
    <>

      <div className="mt-20 bg-slate-200	w-full h-lvh top-0 left-0">
        <div className="flex justify-evenly	items-center	">
          <div>
            <p className="text-6xl font-serif leading-tight	 text-black tracking-wider pl-5">
              The Perfect Door
              <br /> For every <br />
              Occasion
            </p>
          </div>
          <div>
            <div>
              <div
                style={{
                  border: "1px solid gray",
                  background: "#F8F8F8",
                  height: "630px",
                  width: "480px",
                  borderTopLeftRadius: "50%",
                  borderTopRightRadius: "50%",
                  marginTop: "18%",
                }}
              >
                <img
                  src={banner}
                  height="400px"
                  width="200px"
                  style={{ marginTop: "22%", marginLeft: "28%" }}
                />
              </div>
            </div>
            <div>
              <img src={high} className="animate-spin  rotate-180" style={{marginTop:"-35%",marginLeft:"-30%"}} />
              <div style={{marginTop:"-22%",marginLeft:"-18%"}} className="text-4xl">25k</div>
            </div>
          </div>
        </div>
      </div>

      {/* section2 */}

      <div>
          <p className="text-4xl font-serif text-black p-8text-center">Shop By Category</p>
      </div>
    </>
  );
};
export default Home;
